import React from 'react';
import { Link } from 'react-router-dom';

import menu from "../assets/menu.png";

const Navbar = ({ toggleVisibility, isVisible }) => {
    return (
        <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', background: 'none', width: '100%' }}>
            {isVisible && (
                <ul style={{ listStyleType: 'none', display: 'flex', padding: '0', margin: '0' }}>
                    <li style={{ marginRight: '20px' }}>
                        <div
                            onClick={() => setCurrentPage('calendar')}
                            style={{
                                padding: '10px 20px',
                                borderRadius: '5px',
                                border: 'none',
                                backgroundColor: '#4CAF50',
                                color: '#fff',
                                cursor: 'pointer',
                                fontSize: '50px',
                                fontFamily: 'Dancing Script, cursive'
                            }}
                        >
                            Add Entry
                        </div>
                    </li>
                    <li>
                        <div
                            onClick={() => setCurrentPage('viewdata')}
                            style={{
                                padding: '10px 20px',
                                borderRadius: '5px',
                                border: 'none',
                                backgroundColor: '#4CAF50',
                                color: '#fff',
                                cursor: 'pointer',
                                fontSize: '50px',
                                fontFamily: 'Dancing Script, cursive'
                            }}
                        >
                            View Timeline
                        </div>
                    </li>
                </ul>
            )}
            
            {/* Profile Button */}
            <div style={{ marginLeft: 'auto' }}>
                <div onClick={toggleVisibility} style={{ cursor: 'pointer' }}>
                    <Link to="/profile" style={{ textDecoration: 'none' }}>
                        <div
                            style={{
                                padding: '10px 20px',
                                borderRadius: '5px',
                                border: 'none',
                                height: '120px',
                                width: '120px',
                                backgroundImage: `url(${menu})`,
                                backgroundPosition: 'center',
                                backgroundSize: 'cover',
                                cursor: 'pointer',
                                fontFamily: 'Dancing Script, cursive'
                            }}
                        >
                        </div>
                    </Link>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
